.tab-bar {
  height: 30px;
  background: #1d1813;
  padding: 0 13px 0 10px;
  box-sizing: border-box;
}
.tab-bar:after {
  content: "";
  position: absolute;
  bottom: 0;
  height: 8px;
  left: 0px;
  width: 100%;
}
.tab-bar .tab {
  position: relative;
  top: 0;
  height: 30px;
  line-height: 30px;
  color: #7e705a;
  padding-left: 0;
  margin-left: 15px;
  transition: color 0.1s ease-in;
}
.tab-bar .tab:before {
  content: '';
  position: absolute;
  top: 0;
  left: -18px;
  height: 30px;
  width: 40px;
}
.tab-bar .tab .close-icon {
  display: none;
  transition: color 0.1s;
}
.tab-bar .tab .close-icon:hover {
  color: #cb6077 !important;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  display: block;
  top: 12px;
  right: 14px;
  width: 8px;
  height: 8px;
  border-color: #8ab3b5;
}
.tab-bar .tab:first-child {
  margin-left: 20px;
}
.tab-bar .tab:hover .close-icon {
  display: block;
}
.tab-bar .tab.active {
  z-index: 10;
  line-height: 27px;
  color: #e9e1dd;
}
.tab-bar .tab.active .title {
  position: relative;
  top: 1px;
}
