  height: 30px;
}
.tab-bar .tab:hover {
  color: #e9e1dd;
}
.tab-bar .tab.active:hover .close-icon {
  color: #e9e1dd;
}
.tab-bar .placeholder {
  height: 38px;
}
.tab-bar .placeholder:after {
  top: 38px;
}
