.tree-view {
  font-size: 11px;
  font-family: 'Lucida Grande', 'Segoe UI', sans-serif;
  background-color: #2c251e;
}
.tree-view > .directory.entry.selected:before {
  height: 30px;
}
.focusable-panel {
  opacity: 1;
}
.focusable-panel:focus .selected > .name,
.focusable-panel:focus .selected > .name:before,
.focusable-panel:focus .selected > .list-item > .name,
.focusable-panel:focus .selected > .list-item > .name:before {
  color: #fff !important;
}
.key-binding {
  display: inline-block;
  line-height: 100%;
  border-radius: 2px;
  margin-left: 5px;
  font-family: Helvetica, Arial, sans-serif;
  font-size: 10px;
  padding: 5px;
}
.badge {
  font-weight: normal;
